import React, { Component } from 'react'

export default class Passwordrec extends Component {
    render() {
        return (
            <div className="modal">
                <label htmlFor="email">Enter you email</label>
                <input type="email" name="email"/>
                <button className="btn-primary">Submit</button>
            </div>
        )
    }
}
